import axios from 'axios';
import { useContext } from 'react'
import { Container } from 'react-bootstrap';
import { useForm } from "react-hook-form";
import { AuthenticateContext } from './AuthContext';
import { useNavigate } from 'react-router-dom'

const api = axios.create({ baseURL: 'http://localhost:2020/api/v1/' });

export default function Auth() {

        const { register, handleSubmit } = useForm();
        const [, setAuthInfo] = useContext(AuthenticateContext)
        const navigate = useNavigate()
        const Submit = (data) => {
            api.post('login', {
                "email": data.email,
                "password": data.password
            }).then(res => {
                setAuthInfo(()=>({
                    token:res.data,
                    isAuthenticated:true
                }))
                navigate('/CarsManager')
                console.log(res.data)
                
            })
        }
    return (
        <Container>
            <h1 className='text-succes'>Login</h1>
            
        </Container>    
    )
}
